Im gonna need you all to listen to this @audible original, ‘Michelle Rojas Is Not Okay” - available for free on @audible or wherever you get your podcasts! 
Que orgullo to play ‘Dora’ a character so close to me- boisterous, fun and a ride or die friend from Guashington Heights🇩🇴! Thank you @gzouain and  @wendyvmuniz for including me in such a hilarious and important project, highlighting mental health in our community 👌🏽 shouts to 
 @sotospeak8 @jfernz for the 🖊 game !!! And @sheisdash @thekidmero @rachellaloca @lajulissa @glorelysmora and the whole amazing team for killing it!!! CLICK THE LINK IN BIO !

So excited to share that our short film “Bronx Riviera” will be airing at the Big AppleFilm Festival on May 20th! So grateful for our director and writer @shamir_arzeno for including me ! And pairing me up with my boo @missbigb ! 
Also, a huge shoutout to the amazing cast and crew that killed it on this project !  @arturobaezfilms @its_amaury @forthexperience  @marcel.leif 
@lia.lizardo @beatsbyflora @ryan.lizardo @curlella @theambitiouslife @s.a.n 
