Bronx Riviera highlights two best friends from The Bronx!!! who take a transformative trip 🍄 on the shores of Orchard Beach baby !  Let's celebrate the healing power of magic mushrooms and the transformative power of film! Click the link in my bio for tickets to the premiere. #BronxRiviera #BigAppleFilmFestival #FilmPremiere #IndieFilm #LatinxFilmmakers #SelfDiscovery #Friendship #Identity #Grateful #Thankful #SupportIndieFilm #MagicMushrooms #HealingPower #Psilocybin #MentalHealth #RestorativePower #Nature #LinkInBio #dominicanfilm #dominicanfilmmakers #dominicanmade #bronxmade #orchardbeach #madeinnyc

